  [],\n\t\"revision_timestamp\": \"2015-06-17T01:57:33.165409\",\n\t\"name\": \"1983-walrus-harvest-health-and-welfare-study-at-savoonga-alaska-progress-report\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Between April 14th and June 5th, the FWS
  monitored the spring harvest of walruses taken by Native hunters of Savoonga on
  St. Lawrence Island, Alaska. The effort was part of an ongoing study conducted by
  the FWS during the past four years to assess the spring harvest of walrus by five
  Alaskan coastal villages. The FWS was mandated management responsibilities for walrus
  by the Marine Mammals Protection Act of 1972. The objectives of the study were to:
  determine the number, sex, and age of walruses harvested by Savoonga hunters; document
  hunting effort and methods; determine bioaccumulation levels of heavy metal contaminants
  and chlorinated hydrocarbons in liver, kidney, and blubber tissues; and document
  the harvest of other marine mammals and birds.\",\n\t\"license_title\": \"License
